on><section class=\"zn--idx-8 zn-empty\"> </section><div class=\"ad ad--epic ad--all t-dark\"><div id=\"ad_bnr_btf_02\" class=\"ad-ad_bnr_btf_02 ad-refresh-adbody\"></div></div></div><script>var CNN = CNN || {};CNN.contentModel = {                           layout:             \"no-rail\"                                                  , sectionName:      \"homepage\"                                                , pageType:         \"section\"                                                        , env:              \"prod\"                                                            , type:             \"page\"                                                      , analytics:        {\"pageTop\":{},\"headline\":\"\",\"author\":\"\",\"showName\":\"\",\"subSectionName\":\"\",\"isArticleVideoCollection\":false,\"publishDate\":\"2017-12-23T07:33:36Z\",\"pageBranding\":\"default\",\"chartbeat\":{\"sections\":\"\"},\"branding_content_page\":\"default\",\"branding_content_zone\":[\"default\"],\"branding_content_container\":[\"default\",\"cnn-money-markets\",\"app-destination-hub-hp\",\"cnn-heroes\",\"tailgating\"],\"branding_content_card\":[\"\"]}                                                   , edition:          \"domestic\"                                                       , title:            \"CNN - Breaking News, Latest News and Videos\"                                                 , siblings:         {\"articleList\":[{\"uri\":\"/2017/12/22/asia/japan-north-korea-ghost-ships-intl/index.html\",\"headline\":\"\\u003cstrong>A Japanese coastal community is dealing with a sudden influx of boats carrying bodies\\u003c/strong>\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171220205644-north-korea-ghost-ships-watson-2-small-11.jpg\",\"duration\":\"\",\"description\":\"Ryosen Kojima opens a sliding door, enters the Zen Buddhist temple that his family has operated for four generations, and lights two candles.\",\"layout\":\"\"},{\"uri\":\"/videos/world/2017/12/21/ghost-ships-of-nk-watson-pkg.cnn\",\"headline\":\"A disturbing mystery along Japan's coast \",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171221112757-ghost-ships-of-nk-watson-pkg-00001324-small-11.jpg\",\"duration\":\"02:59\",\"description\":\"CNN's Ivan Watson travels to Akita Prefecture, Japan, to investigate the mysterious phenomenon of North Korean boats washing ashore.\",\"layout\":\"\",\"iconType\":\"video\"},{\"uri\":\"/2017/12/22/politics/un-us-north-korea-resolution/index.html\",\"headline\":\"UN adopts tough new sanctions on North Korea\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/170922102439-kim-jong-un-september-small-11.jpg\",\"duration\":\"\",\"description\":\"The UN Security Council unanimously adopted a new set of draconian US-drafted sanctions on North Korea that will further strangle its energy supplies and tighten restrictions on smuggling and the use of North Korean workers overseas. \",\"layout\":\"\"},{\"uri\":\"/2017/12/21/asia/ww1-australia-submarine-found-intl/index.html\",\"headline\":\"Australia's oldest submarine found after 103 years\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171221101028-02-lost-australian-sub-found-hmas-ae1-small-11.jpg\",\"duration\":\"\",\"description\":\"The wreck of Australia's first submarine has been discovered off the coast of Papua New Guinea after disappearing without a trace 103 years ago.\",\"layout\":\"\"},{\"uri\":\"/2017/12/22/us/miss-america-organization-emails/index.html\",\"headline\":\"Miss America pageant rocked by report\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222141943-03-miss-america-emails-mallory-hagan-small-11.jpg\",\"duration\":\"\",\"description\":\"Dozens of former Miss Americas are collectively calling for the resignation of the organization's leadership after a report revealed purported emails from the CEO, board members and others disparaging pageant contestants.\",\"layout\":\"\"},{\"uri\":\"/2017/12/22/us/san-francisco-alleged-terror-attack-thwarted/index.html\",\"headline\":\"FBI: Ex-Marine plotted San Francisco attack\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222184704-marine-jameson-small-11.jpg\",\"duration\":\"\",\"description\":\"A former US Marine talked with an undercover FBI employee about carrying out a terror attack over the holidays at Pier 39, a busy shopping and tourist area in San Francisco, according to an affidavit filed in US District Court in California on Friday.\",\"layout\":\"\"},{\"uri\":\"/2017/12/23/us/thomas-fire-california/index.html\",\"headline\":\"California wildfire reaches record size\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171211101533-01-california-wildfire-1210-small-11.jpg\",\"duration\":\"\",\"description\":\"The Thomas Fire is now the largest wildfire in California's modern history after torching 273,400 acres.\",\"layout\":\"\"},{\"uri\":\"/2017/12/23/asia/philippines-tropical-storm-tembin/index.html\",\"headline\":\"Storm kills dozens in the Philippines \",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171223150830-01-storm-tembin-small-11.jpg\",\"duration\":\"\",\"description\":\"Tropical Storm Tembin hit the southern island of Mindanao in the Philippines on Friday, killing at least 39 people, authorities said. \",\"layout\":\"\"},{\"uri\":\"/videos/politics/2017/12/23/cnn-sexual-harassment-poll-bts-ebof.cnn\",\"headline\":\"Dems, GOP deeply divided on sexual harassment\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171020095436-me-too-006-hands-small-11.jpg\",\"duration\":\"01:55\",\"description\":\"Americans view sexual harassment far more seriously than they did two decades ago, according to a new CNN poll.\",\"layout\":\"\",\"iconType\":\"video\"},{\"uri\":\"/2017/12/22/politics/donald-trump-no-news-conference/index.html\",\"headline\":\"\\u003cstrong>Aides scuttled Trump's celebratory news conference\\u003c/strong>\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222111337-president-trump-signs-tax-bill-12-22-2017-small-11.jpg\",\"duration\":\"\",\"description\":\"President Donald Trump \\u003ca href=\\\"http://www.cnn.com/2017/12/22/politics/trump-sign-tax-bill-mar-a-lago/index.html\\\">told aides he was eager to take questions Friday \\u003c/a>and hold a news conference to tout his accomplishments before leaving for Mar-a-Lago, but some advisers argued against it.\",\"layout\":\"\"},{\"uri\":\"/2017/12/22/politics/doj-rescinds-guidance-memos/index.html\",\"headline\":\"Under Obama, judges were encouraged to avoid fining poor defendants. Not anymore\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222195730-homeless-man-sleeping-small-11.jpg\",\"duration\":\"\",\"description\":\"The Justice Department on Thursday rescinded a tranche of agency-issued \\\"guidance documents\\\" that explained and interpreted policy across a range of issues, including a 2016 memo that cautioned courts against the burdensome enforcement of fines for criminal offenders. \",\"layout\":\"\"},{\"uri\":\"/2017/12/22/politics/us-ambassador-to-netherlands-denies-own-comments/index.html\",\"headline\":\"US ambassador denies own comments and then denies denial\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222110145-us-ambassador-netherlands-interview-small-11.jpg\",\"duration\":\"\",\"description\":\"The new US ambassador to the Netherlands lied twice to a Dutch news crew about 2015 comments he made saying the country was in chaos because of Muslims.\",\"layout\":\"\"},{\"uri\":\"/2017/12/22/opinions/vice-president-sycophant-pence-trump-goldstein-opinion/index.html\",\"headline\":\"Opinion: Pence's dangerous bromance\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171221200436-trump-pence-moos-12-21-small-11.jpg\",\"duration\":\"\",\"description\":\"The job of any vice president of the United States includes being a salesperson for the administration and a defender of the president. Vice President Mike Pence is certainly not the first to make the case for the chief executive he serves, but none of Pence's predecessors has championed their president so consistently and effusively -- especially outside campaign season -- as has the 48th vice president.  Pence has compared Donald J. Trump to \\u003ca href=\\\"https://www.politico.com/story/2016/07/mike-pence-trump-ronald-reagan-225812\\\" target=\\\"_blank\\\">Ronald Reagan\\u003c/a> and \\u003ca href=\\\"http://www.washingtonexaminer.com/mike-pence-trumps-vision-energy-and-can-do-spirit-is-reminiscent-of-president-teddy-roosevelt/article/2631913\\\" target=\\\"_blank\\\">Theodore Roosevelt, \\u003c/a>and the accolades only go north from there.   \",\"layout\":\"\"},{\"uri\":\"/videos/cnnmoney/2017/12/19/war-on-christmas-orig-kludt.cnnmoney\",\"headline\":\"How Fox fueled 'war on Christmas' news\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171219070701-fox-war-on-christmas-small-11.jpg\",\"duration\":\"04:23\",\"description\":\"For more than a decade, a Fox News holiday tradition has been extensive coverage of the \\\"war on Christmas.\\\" CNN's Tom Kludt shows how the same elements that fueled Fox News' \\\"war on Christmas\\\" coverage can also be found in the 2016 Presidential campaign of the most powerful Fox News viewer in the world.\",\"layout\":\"\",\"iconType\":\"video\"},{\"uri\":\"/videos/politics/2017/12/22/mitch-mcconnell-steve-bannon-political-genius-sot.cnn\",\"headline\":\"Mitch McConnell slams Steve Bannon \",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222112008-mitch-mcconnell-steve-bannon-political-genius-sot-00000000-small-11.jpg\",\"duration\":\"02:11\",\"description\":\"Senate Majority Leader Mitch McConnell criticized Steve Bannon following the GOP's election loss in Alabama at his end-of-year press conference.\",\"layout\":\"\",\"iconType\":\"video\"},{\"uri\":\"/2017/12/22/health/doctor-opioid-prescription/index.html\",\"headline\":\"Doctor faces charges over 5 patient deaths\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171222101602-01-raymond-kraynak-file-small-11.jpg\",\"