s study spotlights rare risks\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/170301152038-07-popular-cosmetic-procedures-small-11.jpg\",\"duration\":\"\",\"description\":\"You can go blind from dermal fillers? Though they're extremely rare cases, a new paper sheds light on what can go wrong with minimally invasive filler injections, which are on the rise.\",\"layout\":\"\"},{\"uri\":\"/2017/12/21/opinions/best-of-2017-opinions/index.html\",\"headline\":\"30 top takes of 2017\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171219185919-20171220-30-top-takes-of-2017-illustration-purple-small-11.jpg\",\"duration\":\"\",\"description\":\"In a year dominated by the beginning of the Trump presidency, readers came to CNN Opinion looking for insight into the man occupying the highest office in the land. But Donald Trump's many actions and tweets weren't the only subjects of interest. Stories of racism and white supremacist groups, workplace sexual harassment, freedom of the press and a series of horrific natural disasters attracted your attention, too.\",\"layout\":\"\"},{\"uri\":\"/travel/article/best-new-luxury-hotels-2017-lti/index.html\",\"headline\":\"Best new luxury hotel of 2017 revealed\",\"thumbnail\":\"//cdn.cnn.com/cnnnext/dam/assets/171220100430-bulgari-resort-exterior-small-11.jpg\",\"duration\":\"\",\"description\":\"Bulgari Resort Dubai has only been open for a matter of weeks, but it's already been crowned the best new luxury hotel of 2017.\",\"layout\":\"\"}]}                     , registryURL: \"//cdn.cnn.com/ads/cnn/cnn_homepage.js\", entitlementSingletons: [{\"id\":\"ad_mod_3bc717c42\",\"scriptName\":\"//cdn.cnn.com/ads/cnn/singles/cnn_entitlement_hp_01.js\"},{\"id\":\"ad_mod_1963034fc\",\"scriptName\":\"//cdn.cnn.com/ads/cnn/singles/cnn_entitlement_hp_02.js\"},{\"id\":\"ad_mod_ff88f43a7\",\"scriptName\":\"//cdn.cnn.com/ads/cnn/singles/cnn_entitlement_hp_03.js\"},{\"id\":\"ad_mod_e6ebd187c\",\"scriptName\":\"//cdn.cnn.com/ads/cnn/singles/cnn_entit